import owpNavigationConfigKR from './owpNavigationConfig-kr.json';
import owpNavigationConfigEN from './owpNavigationConfig-en.json';

const resources = {
    en: owpNavigationConfigEN,
    kr: owpNavigationConfigKR
};

const owpNavigationConfig = (language) => {
    return resources[language];
}

export default owpNavigationConfig;
